import './App.css';
import axios from 'axios';
import { useState,useEffect } from 'react';

const api = axios.create({
  baseURL:`https://jsonplaceholder.typicode.com/todos`
})

async function createCourse(){
  let res = await api.post('/',{userId:201,id:201,title:"chocolate syrup",completed:false})
  console.log(res);
}


function App() {

  const [todos,setTodos] = useState([])


  useEffect(()=>{
    api.get('/').then(res =>{
      console.log(res.data);
      setTodos(res.data);
    })
  },[todos])

  return (
    <div className="App">

        <button onClick={createCourse}>create todo</button>
        {todos.map(todo => <h2 key={todo.id}>{todo.title}</h2>)}
    </div>
  );
}

export default App;
